import React, { Component } from "react";
import Slider from "react-slick";

const SimpleSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div h-auto w-full>
      <Slider {...settings}>
        <img className="h-12 w-12" src="/banner.png" alt="" />
      </Slider>
    </div>
  );
};

export default SimpleSlider;
